 custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'Показва архив на собствена таксономия. Също като категориите и етикетите, таксономиите имат термини, които използвате, за да класифицирате неща. Например: таксономия с име „Изкуство“ може да има множество термини, като „Модерно“ и „18-ти век“. Този шаблон ще служи като резервен вариант, когато не може да бъде намерен по-специфичен шаблон (напр. Таксономия: „Изкуство“).','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'Показва архив на категория публикации. Този шаблон ще служи като резервен вариант, когато не може да бъде намерен по-специфичен шаблон (напр. Категория: Рецепти).','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'Показва архив с публикациите на конкретен автор. Този шаблон ще служи като резервен вариант, когато не може да бъде намерен по-специфичен шаблон (напр. Автор: Администратор).','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'Показва всеки архив, включително публикациите от дадени автор, категория, етикет, таксономия, допълнителен тип съдържание или дата. Този шаблон ще служи като резервен вариант, когато не могат да бъдат намерени по-конкретни шаблони (напр. Категория или Етикет).','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'Показва статични страница, освен ако в страницата не се използват собствен шаблон или е създаден такъв специално.','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'Показва отделна публикация в сайта ви, освен ако не е приложен персонализиран шаблон или не е създаден такъв специално.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'Показва всеки отделен запис, като например публикация или страница. Този шаблон ще служи като резервен вариант, когато не може да бъде намерен по-специфичен шаблон (например отделна публикация, страница или прикачен файл).','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Показва началната страница на сайта ви, независимо дали е настроена да показва най-новите публикации или статична страница. Шаблонът за Начална страница е с предимство пред всички останали шаблони.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'Показва най-новите публикации като начална страница на сайта или персонализирана страница, дефинирана в Настройки > Четене. Ако съществува, шаблонът за Начална страница заменя този шаблон, когато публикациите се показват на началната страница.','Used as a fallback template for all pages when a more specific template is not defined.'=>'Използва се като резервен шаблон за всички страници, когато не е дефиниран по-конкретен шаблон.','Block pattern categoryAbout'=>'За мен','Block pattern categoryTeam'=>'Екип','Block pattern categoryPosts'=>'Публикации','Block pattern categoryBanners'=>'Банери','block descriptionThe author name.'=>'Име на автора','block titleAuthor Name'=>'Име на автора','block keywordpage'=>'стра