дай сайт или само потребителско име:','Site Domain (subdomain only):'=>'Домейн на сайта (само поддомейн):','Site Name (subdirectory only):'=>'Име на сайта (само поддиректория):','There doesn\'t seem to be a %s file. It is needed before the installation can continue.'=>'Изглежда, че липсва файлът %s. Необходим е преди инсталацията да може да продължи.','The date and time the preferences were updated.'=>'Настройките за дата и време са обновени.','Whether the theme disables generated layout styles.'=>'Дали темата изключва генерирани стилове за оформлението.','Whether a theme uses block-based template parts.'=>'Използва ли темата части от темплейти на базата на блокове.','$store must be an instance of WP_Style_Engine_CSS_Rules_Store'=>'$store трябва да бъде инстанция на WP_Style_Engine_CSS_Rules_Store','Revisions not enabled.'=>'Ревизиите са изключени.','The template prefix for the created template. This is used to extract the main template type, e.g. in `taxonomy-books` extracts the `taxonomy`'=>'Префиксът за създадения шаблон. Това се използва за извличане на основния тип шаблон, напр. в `таксономия-книги` извлича `таксономията`','Indicates if a template is custom or part of the template hierarchy'=>'Показва дали шаблонът е потребителски или част от шаблонната йерархия','The slug of the template to get the fallback for'=>'Краткото име на шаблона, който да се приеме за резервен вариант','The icon for the post type.'=>'Икона за типа съдържание.','If the value is a string, the value will be used as the archive slug. If the value is false the post type has no archive.'=>'Ако стойноста е низ, стойноста ще се използва като архивирано кратно име. Ако стойността е грешна, тип съдържанието няма архив.','Public facing and editor style handle. DEPRECATED: Use `style_handles` instead.'=>'Управление на oбществено лице и стил на редактор. НЕ СЕ ИЗПОЛЗВА: Вместо това се използва `style_handles`.','Editor style handle. DEPRECATED: Use `editor_style_handles` instead.'=>'Управление за стил на редактор.НЕ СЕ ИЗПОЛЗВА: Вместо това се използва `editor_style_handles` .','Public facing script handle. DEPRECATED: Use `view_script_handles` instead.'=>'Управление на oбществено лице и скрипт. НЕ СЕ ИЗПОЛЗВА: Вместо това се използва `view_script_handles`.','Public facing and editor script handle. DEPRECATED: Use `script_handles` instead.'=>'Управление на oбществено лице и редакторски скрипт. НЕ СЕ ИЗПОЛЗВА: Вместо това се използва `script_handles`.','Editor script handle. DEPRECATED: Use `editor_script_handles` instead.'=>'Управление на стил на скрипт. НЕ СЕ ИЗПОЛЗВА: Вместо това се използва `editor_script_handles`.','An array of post types that the pattern is restricted to be used with.'=>'Масив от типове съдържание, с които макетът е ограничен да работи.','REST API %1$s should be an array of arrays. Non-array value detected for %2$s.'=>'REST API %1$s трябва да е масив от масиви. Немасива стойност открита за %2$s.','If you are the owner of this network please check that your host&#8217;s database server is running properly and all tables are error free.'=>'Ако сте собственика на тази мрежа проверете дали сървърът с базата данни на сайта ви работи нормално и дали няма грешки в таблиците.','<strong>Conflicting values for the constants %1$s and %2$s.</strong> The value of %2$s will be assumed to be your subdomain configuration setting.'=>'<strong>Стойностите на константите %1$s и %2$s са в конфликт.</strong> За конфигурацията ще се приеме стойността на %2$s, и вашата мрежа ще работи с поддомейни.','*'=>'*','Logged in as %1$s. <a href="%2$s">Edit your profile</a>. <a href="%3$s">Log out?</a>'=>'Вписан като %1$s. <a href="%2$s">Редактирайте си профила</a>. <a href="%3$s">Изход?</a>','%sX-Large'=>'%sX-Голям','%sX-Small'=>'%sX-Малък','Your %1$s file uses a dynamic value (%2$s) for the path at %3$s. However, the value at %3$s is also a dynamic value (pointing to %4$s) and pointing to another dynamic value is not supported. Please update %3$s to point directly to %4$s.'=>'Вашият %1$s файл използва динамична стойност (%2$s) за пътя %3$s. Все пак, стойността на %3$s също е динамична стойност (сочейки към %4$s) и сочейки към друга динамична стойност не е поддържана. Нужно е обновяване на %3$s да сочи директно към %4$s.','put your unique phrase here'=>'поставете вашата уникална фраза тук','Cache key must be an integer or a non-empty string, %s given.'=>'Кеш ключът трябва да бъде цяло число или непразен низ, а е зададен %s.','Cache key must not be an empty string.'=>'Ключът за кеширане не може да е празен низ.','There has been a critical error on this website. Please reach out to your site administrator, and inform them of this error for further assistance.'=>'Възникна критична грешка в сайта. Обърнете се към администратора на сайта си и го информирайте за грешката, за да получите по-нататъшна помощ.','When checking for the %s capability, you must always check it against a specific user.'=>'При проверка за правото %s, винаги трябва да се проверява конкретен потребител.','When checking for the %s capability, you must always check it against a specific term.'=>'При проверка за правото %s, винаги трябва да се проверява срещу конкретен термин.','When checking for the %s capability, you must always check it against a specific comment.'=>'При проверка за правото %s, винаги трябва да се проверя спрямо конкретен коментар.','When checking for the %s capability, you must always check it against a specific page.'=>'При проверка за наличие на правото %s, винаги трябва да се проверя спрямо конкретна страница.','When checking for the %s capability, you must always check it against a specific post.'=>'При проверка за правото %s, винаги трябва да се проверя спрямо конкретна публикация.','Your object cache implementation does not support flushing individual groups.'=>'Имплементацията ви на обектно кеширане не поддържа изчистване отделни групи.','Your object cache implementation does not support flushing the in-memory runtime cache.'=>'Имплементацията ви на обектно кеширане не поддържа изчистване на кеша за изпълнение в паметта.','Deleted author: %s'=>'Изтрит автор: %s','Template for %s'=>'Шаблон за %s','Not found: %1$s (%2$s)'=>'Не е намерен: %1$s (%2$s)','Block pattern categoryFooters'=>'Долна част','Cron unschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Cron грешка при непланирано събитие за кука: %1$s, Грешен код: %2$s, Грешно съобщение: %3$s, Данни: %4$s','Cron reschedule event error for hook: %1$s, Error code: %2$s, Error message: %3$s, Data: %4$s'=>'Cron грешка при планирано събитие за кука: %1$s, Грешен код: %2$s, Грешно съобщение: %3$s, Данни: %4$s','Whether a theme uses block-based templates.'=>'Използва ли темата темплейти на базата на блокове. ','The ID of the page that should display the latest posts'=>'ID на страницата, която трябва да показва най-новите публикации.','The ID of the page that should be displayed on the front page'=>'ID на страницата, която да се показва като заглавна страница','What to show on the front page'=>'Какво се показва на началната страница','File %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'Файлът %1$s <strong>не се използва</strong> след версия %2$s и няма налична алтернатива.','File %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'<strong>Не се препоръчва използването</strong> на файла %1$s след версия %2$s! Вместо него използвайте %3$s.','Function %1$s is <strong>deprecated</strong> since version %2$s with no alternative available.'=>'Функция %1$s <strong>не се използва</strong> след версия %2$s и няма налична алтернатива.','Function %1$s is <strong>deprecated</strong> since version %2$s! Use %3$s instead.'=>'Функция %1$s <strong>не се използва</strong> след версия %2$s. Използвайте %3$s.','block descriptionDisplays the link of a post, page, or any other content-type.'=>'Показва връзка към публикация, страница или друг тип съдържание.','block titleRead More'=>'Прочетете повече','block descriptionContains the block elements used to render content when no query results are found.'=>'Съдържа блоковите елементи, използвани за изобразяване на съдържание, когато не са намерени резултати от заявката.','block titleNo results'=>'Няма намерени резултати','block descriptionDisplay post author details such as name, avatar, and bio.'=>'Показване на подробности за автора на публикацията като име, аватар и биография.','block descriptionThe author biography.'=>'Биография на автора','block titleAuthor Biography'=>'Биография на автора','block descriptionCreate a link that always points to the homepage of the site. Usually not necessary if there is already a site title link present in the header.'=>'Създава връзка, която винаги сочи към началната страница на сайта. Обикновено не е необходимо, ако вече има връзка в заглавието на сайта.','block titleHome Link'=>'Връзка към начална страница','block descriptionGather blocks in a layout container.'=>'Съберете блокове в контейнер за оформление.','block descriptionDisplays a title with the number of comments.'=>'Показва заглавие с броя на коментарите.','block titleComments Title'=>'Заглавие на коментарите','block descriptionAn advanced block that allows displaying post comments using different visual configurations.'=>'Блок, който позволява показване на коментарите към публикация с избор на различни визуални конфигурации.','block descriptionDisplays a paginated navigation to next/previous set of comments, when applicable.'=>'Показва навигация със странициране към следващия/предишния набор от коментари, когато е приложимо.','block titleComments Pagination'=>'Странициране на коментарите','block descriptionDisplays the previous comment\'s page link.'=>'Показва връзката към страницата на предишните коментари.','block descriptionDisplays a list of page numbers for comments pagination.'=>'Показва списък с номерата от страницирането на коментарите.','block descriptionDisplays the next comment\'s page link.'=>'Показва връзката към страницата на следващите коментари.','block descriptionContains the block elements used to display a comment, like the title, date, author, avatar and more.'=>'Съдържа блоковите елементи, използвани за показване на коментар, като заглавие, дата, автор, аватар и др.','block titleComment Template'=>'Шаблон за коментари','block descriptionDisplays a link to reply to a comment.'=>'Показва връзка за отговор на коментар.','block titleComment Reply Link'=>'Връзка за отговор на коментара','block descriptionDisplays a link to edit the comment in the WordPress Dashboard. This link is only visible to users with the edit comment capability.'=>'Показва връзка за редактиране на коментара в таблото за управление на WordPress. Тази връзка се вижда само от потребители с възможност за редактиране на коментари.','block titleComment Edit Link'=>'Връзка за редакция на коментара','block descriptionDisplays the date on which the comment was posted.'=>'Показва датата, на която коментарът е публикуван.','block descriptionDisplays the contents of a comment.'=>'Показва съдържанието на коментар.','block descriptionDisplays the name of the author of the comment.'=>'Показва името на автора на коментара.','block titleComment Author Name'=>'Име на автора на коментара','block descriptionAdd a user’s avatar.'=>'Добавяне на аватар на потребителя.','block titleAvatar'=>'Аватар','A WordPress Commenter'=>'Коментатор от WordPress','Responses to %s'=>'Отговора на %s','Response to %s'=>'Отговор на %s','block titleComment Date'=>'Дата на коментара','block titleComment Content'=>'Съдържание на коментара','Default Avatar'=>'Аватар по подразбиране','There is already a ping from that URL for this post.'=>'Вече има ping от този адрес за тази публикация.','The password cannot be a space or all spaces.'=>'Паролата не може да бъде интервал или множество интервали.','Need more help? <a href="%1$s">Read the support article on %2$s</a>.'=>'Нуждаете се 