фт трябва да бъде правилно форматиран низ или цяло число. ','Each webfont src must be a non-empty string.'=>'Семейството от шрифтове на уеб-базирания шрифт не може да бъде празен низ.','Webfont src must be a non-empty string or an array of strings.'=>'Webfont src трябва да не бъде празен низ или ред от низове','Webfont font family must be a non-empty string.'=>'Семейството от шрифтове на уеб-базирания шрифт не може да бъде празен низ.','Limit results to those matching a pattern (slug).'=>'Ограничаване на резултатите до тези, които отговарят на структурата (кратко име).','Ancestor blocks.'=>'Блокове предшественици.','Determines whether the pattern is visible in inserter.'=>'Определя дали макетът е видим в лентата за добавяне.','The pattern keywords.'=>'Ключови думи за този шаблон.','The pattern category slugs.'=>'Кратки имена на категориите на макета.','Block types that the pattern is intended to be used with.'=>'Типове блокове, с които шаблонът е предназначен да се използва.','The pattern viewport width for inserter preview.'=>'Ширината на изгледа на модела за визуализация на вмъкването.','The pattern detailed description.'=>'Подробно описание на модела.','The pattern name.'=>'Име на шаблон.','Sorry, you are not allowed to view the registered block patterns.'=>'За съжаление не можете да преглеждате регистрираните блокови модели.','The category label, in human readable format.'=>'Името на блока.','The category name.'=>'Име на новата категория.','Sorry, you are not allowed to view the registered block pattern categories.'=>'Нямате право да разглеждате локалната директория с макети от блокове.','Error in deleting the attachment.'=>'Грешка при изтриването на прикачения файл.','<strong>Error:</strong> This is not a valid feed template.'=>'<strong>Грешка</strong>: Това не е валиден шаблон за RSS поток. ','unit symbolPB'=>'PB','unit symbolEB'=>'екзабайт','unit symbolZB'=>'ZB','unit symbolYB'=>'YB','The description will be displayed in the menu if the active theme suppo