ешка в едно от вашите разширения, %s.','Howdy!

WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Привет!

WordPress вече има вградена функция, която открива разширение или тема, която предизвиква фатална грешка на сайта ви и ви уведомява с този автоматичен имейл.

###CAUSE### 

Първо посетете уебсайта си (###SITEURL###) и проверете за видими проблеми. След това посетете страницата, където е открита грешката (###PAGEURL###), и проверете за видими проблеми.

###SUPPORT###

Ако сайтът ви изглежда счупен и не можете да получите достъп до таблото си за управление, WordPress вече има специален "режим на възстановяване". Това ви позволява безопасно да влезете в таблото си за управление и да проучите допълнително.

###LINK### 

За да запази сайта ви безопасен, тази връзка ще изтече след ###EXPIRES###. Не се притеснявайте за това обаче, ако грешката се появи отново след изтичането ѝ, ще ви бъде изпратена нова връзка по електронната поща.

