ойство на Object.','You will not be able to install new themes from here yet since your install requires SFTP credentials. For now, please <a href="%s">add themes in the admin</a>.'=>'Няма да можете да инсталирате нови теми оттук, понеже инсталирането изисква SFTP данни за достъп. Засега <a href="%s">добавяйте темите в администраторския панел</a>.','categoriesMost Used'=>'Най-използвани','tagsMost Used'=>'Най-използвани','Click &#8220;Next&#8221; to start adding links to your new menu.'=>'Добавете нови връзки към менюто с бутон &#8220;Нататък&#8221; ','customizer changeset action/button labelSchedule'=>'Планиране','+ Create New Menu'=>'+ Ново меню','Create a menu for this location'=>'Създаване на меню за тази локация','Could not open handle for %1$s to %2$s.'=>'Неуспешно отваряне с %1$s на %2$s.','Add a navigation menu to your sidebar.'=>'Добавяне на меню към страничната колона.','%s has taken over and is currently customizing.'=>'В момента %s настройва.','Looks like something&#8217;s gone wrong. Wait a couple seconds, and then try again.'=>'Изглежда нещо се обърка. Моля, опитайте отново след няколко секунди.','Take over'=>'Поемане на контрола','Go back'=>'Назад','%s is already customizing this site. Please wait until they are done to try customizing. Your latest changes have been autosaved.'=>'В момента %s настройва този сайт. Моля, изчакайте докато приключи. Вашите промени се запазват автоматично в момента.','%s is already customizing this site. Do you want to take over?'=>'В момента %s настройва този сайт. Искате ли да поемете контрола?','Sorry, you are not allowed to take over.'=>'Нямате право да поемете контрола.','No changeset found to take over'=>'Не бе открит набор от промени, върху който да се поеме контрола','Security check failed.'=>'Проверката за сигурност се провали.','Changeset is being edited by other user.'=>'Наборът от промени в момента се редактира от друг потребител.','menu locationsHere&#8217;s where this menu appears. If you would like to change that, pick another location.'=>'Ето къде се показва това меню. Ако искате да промените това, изберете друга позиция.','menu locations(If you plan to use a menu <a href="%1$s" %2$s>widget%3$s</a>, skip this step.)'=>'(Ако планирате да използвате <a href="%1$s" %2$s>джаджа за меню%3$s</a>, прескочете тази стъпка.)','menu locationsWhere do you want this menu to appear?'=>'Къде искате да се показва това меню?','You&#8217;ll create a menu, assign it a location, and add menu items like links to pages and categories. If your theme has multiple menu areas, you might need to create more than one.'=>'Можете да създадете меню, да му зададете позиция и да добавите елементи към него, например връзки към страници или категории. Ако темата ви поддържа повече от една позиция, може да трябва да създадете повече от едно меню.','It does not look like your site has any menus yet. Want to build one? Click the button to start.'=>'Изглежда вашият сайт все още няма никакви менюта. Искате ли да създадете ново? Натиснете бутона, за да започнете.','menu locationsView All Locations'=>'Преглед на всички позиции','While previewing a new theme, you can continue to tailor things like widgets and menus, and explore theme-specific options.'=>'Докато преглеждате нова тема, можете да изпробвате и настройвате разни неща, като джаджи и менюта, и да опитате конкретни настройки на темата.','Looking for a theme? You can search or browse the WordPress.org theme directory, install and preview themes, then activate them right here.'=>'Търсите си тема? Можете да прегледате директорията с теми на WordPress.org, да инсталирате и прегледате теми, и да ги активирате тук, на място.','menu locationsView Location'=>'Преглед на позиция','No themes found. Try a different search.'=>'Няма намерени теми. Опитайте ново търсене.','Your theme can display menus in one location. Select which menu you would like to use.'=>'Темата ви може да показва менюта в една позиция. Изберете менюто, което искате да използвате.','Site Name: %s'=>'Име на сайта: %s','%1$s &lsaquo; %2$s &#8212; WordPress'=>'%1$s &lsaquo; %2$s &#8212; WordPress','The query does not contain the correct number of placeholders (%1$d) for the number of arguments passed (%2$d).'=>'Заявката не съдържа нужния брой подсказки (%1$d) за броя подадени аргументи (%2$d).','Unsupported value type (%s).'=>'Неподдържан тип стойност (%s).','Widgets need to be registered using %s, before they can be displayed.'=>'Джаджите трябва да бъдат регистрирани чрез %s преди да могат да бъдат показвани.','Link to:'=>'Връзка към:','No images selected'=>'Няма избрани изображения','Displays an image gallery.'=>'Показва галерия с изображения.','Gallery'=>'Галерия','Custom HTML Widget'=>'Персонализиран HTML','Use the Custom HTML widget to add arbitrary HTML code to your widget areas.'=>'Използвайте джаджата за персонализиран HTML, за да добавите HTML код към вашите зони за джаджи.','Your email address has not been updated yet. Please check your inbox at %s for a confirmation email.'=>'Вашият имейл адрес все още не е обновен. Моля, проверете вашата поща %s за потвърждение.','Howdy ###USERNAME###,

