###SITEURL###','Only UUID V4 is supported at this time.'=>'Само UUID V4 се поддържа в момента.','The Press This plugin is required.'=>'Изисква се разширението Press This.','%s themes'=>'%s теми','Filter themes (%s)'=>'Филтриране на теми (%s)','Go to theme sources'=>'Към кода на темата','Search WordPress.org themes'=>'Търсене на WordPress.org теми','Install &amp; Preview'=>'Инсталиране и преглед','Invalid URL.'=>'Невалиден адрес.','Time to add some links! Click &#8220;%s&#8221; to start putting pages, categories, and custom links in your menu. Add as many things as you would like.'=>'Време е да добавите малко връзки! Натиснете &#8220;%s&#8221 за да започнете да поставяте страници, категории и собствени връзки в меню си. Добавете колкото пожелаете.','Choose image'=>'Избор на изображение','Choose audio'=>'Избор на аудио','Change audio'=>'Промяна на аудио','Select audio'=>'Избор на аудио','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header height of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Натиснете &#8220;Добавяне на ново изображение&#8221; за да качите изображение от вашия компютър. Темата ви ще работи най-добре с изображение с височина %s пиксела, а вие ще можете да го оразмерите след качване за постигане на желания резултат.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header width of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Натиснете &#8220;Добавяне на ново изображение&#8221; за да качите изображение от вашия компютър. Темата ви ще работи най-добре с изображение с широчина %s пиксела, а вие ще можете да го оразмерите след качване за постигане на желания резултат.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image with a header size of %s pixels &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Натиснете &#8220;Добавяне на ново изображение&#8221; за да качите изображение от вашия компютър. Темата ви ще работи най-добре с изображение с размер %s пиксела, а вие ще можете да го оразмерите след качване за постигане на желания резултат.','Click &#8220;Add New Image&#8221; to upload an image file from your computer. Your theme works best with an image that matches the size of your video &#8212; you&#8217;ll be able to crop your image once you upload it for a perfect fit.'=>'Натиснете &#8220;Добавяне на ново изображение&#8221; за да качите изображение от вашия компютър. Вашата тема ще работи най-добре с изображение, което съвпада с размер по видеото ви. Ще можете да го оразмерите след като го качите, за да постигнете желания резултат.','%1$s-%2$s'=>'%1$s-%2$s','Meridian'=>'Меридиан','Minute'=>'Минута','Hour'=>'Час','Time'=>'Час','Day'=>'Ден','Month'=>'Месец','Date'=>'Дата','Usage of user levels is deprecated. Use capabilities instead.'=>'Използването на нива потребители (user levels) е непрепоръчително -
 използвайте възможности.','The theme defines itself as its parent theme. Please check the %s header.'=>'Тази тема се счита за родителска тема. Моля, проверете хедъра %s.','Name for the Visual editor tabVisual'=>'Визуален редактор','Create New Menu'=>'Създаване на ново меню','New Menu'=>'Ново меню','If your theme has widget areas, you can also add menus there. Visit the <a href="%s">Widgets panel</a> and add a &#8220;Navigation Menu widget&#8221; to display a menu in a sidebar or footer.'=>'Ако темата ви има зони с джаджи, можете да добавяте менюта там. Посетете <a href="%s">секцията с джаджи</a> и добавете джаджата &#8220;Собствено меню&#8221; за да покажете меню в странична лента или футър.','If your theme has multiple menus, giving them clear names will help you manage them.'=>'Ако темата ви има повече от едно менюта, за да ви е по-лесно да ги управлявате е по-добре да им давате ясни имена.','Your theme can display menus in %s location.'=>'Темата ви може да показва менюта в %s позиция.' . "\0" . 'Темата ви може да показва менюта в %s позиции.','Your theme can display menus in one location.'=>'Темата ви може да показва менюта в една позиция.','CSS code'=>'CSS код','The edit field automatically highlights code syntax. You can disable this in your <a href="%1$s" %2$s>user profile%3$s</a> to work in plain text mode.'=>'Полето за редакция автоматично оцветява синтаксиса на кода. Можете да изключите това във вашия <a href="%1$s" %2$s>потребителски профил%3$s</a>, за да работите в режим на обикновен текст.','Screen reader users: when in forms mode, you may need to press the Esc key twice.'=>'За потребители с екранен четец: когато сте в режим на форми, може да трябва да натиснете клавиша Esc два пъти.','To move away from this area, press the Esc key followed by the Tab key.'=>'За да излезете от тази зона, натиснете клавиша Esc, последван от клавиш Tab.','In the editing area, the Tab key enters a tab character.'=>'В зоната за редакция, клавишът Tab въвежда нов знак за отстъп.','When using a keyboard to navigate:'=>'При използване на клавиатурата за навигиране:','Add your own CSS code here to customize the appearance and layout of your site.'=>'Добавете CSS код тук, за да персонализирате външния вид и оформлението на вашия сайт.','Your homepage displays'=>'Вашата начална страница показва','You can choose what&#8217;s displayed on the homepage of your site. It can be posts in reverse chronological order (classic blog), or a fixed/static page. To set a static homepage, you first need to create two Pages. One will become the homepage, and the other will be where your posts are displayed.'=>'Можете да избирате какво да се показва на началната страница на сайта ви. Може да се показват публикации в обратен хронологичен ред (класически блог), или статична страница. За да зададете статична начална страница, първо ще трябва да създадете две страници. Едната ще бъде вашата начална страница, а другата - тази, на която ще се показват вашите публикации.','Homepage Settings'=>'Настройки на началната страница','WordPress.org themes'=>'WordPress.org теми','Installed themes'=>'Инсталирани теми','Publish Settings'=>'Настройки за публикуване','Copied'=>'Копирано','Preview Link'=>'Връзка за преглед','See how changes would look live on your website, and share the preview with people who can\'t access the Customizer.'=>'Прегледайте как промените ще изглеждат на живо на вашия сайт, и споделете с хора, които нямат достъп до настройките на вашия сайт.','Share Preview Link'=>'Връзка за преглед на споделянето','Changes trashed successfully.'=>'Промените бяха изтрити успешно.','Changes have already been trashed.'=>'Промените вече са били изтрити.','Unable to trash changes.'=>'Неуспешно преместване на промените в кошчето.','No changes saved yet, so there is nothing to trash.'=>'Промените не бяха запазени, така че няма какво да се премести в кошчето.','There was an authentication problem. Please reload and try again.'=>'Възникна проблем при удостоверяването. Моля, презаредете и опитайте отново.','Unable to save due to %s invalid setting.'=>'Неуспешнп запазване заради %s невалидна настройка.' . "\0" . 'Неуспешнп запазване заради %s невалидни настройки.','You must supply a future date to schedule.'=>'Трябва да посочите бъдеща дата, за да насрочите.','The previous set of changes has already been published. Please try saving your current set of changes again.'=>'Предишнит промени вече са били публикувани. Моля, опитайте да запазите текущите си промени отново.','Edit User'=>'Редактиране на потребител','View User'=>'Преглед на потребител','This widget may have contained code that may work better in the &#8220;Custom HTML&#8221; widget. If you have not yet, how about trying that widget instead?'=>'Тази джаджа може да е съдържала код, който би работил по-добре в джаджата &#8220;Собствен HTML&#8221;. Ако все още не сте, искате ли да я пробвате?','Hey there, looks like you just pasted HTML into the &#8220;Visual&#8221; tab of the Text widget. You may want to paste your code into the &#8220;Text&#8221; tab instead. Alternately, try out the new &#8220;Custom HTML&#8221; widget!'=>'Изглежда сте поставили HTML в секцията &#8220;Визуален редактор&#8221; на джаджата Текст. Може би искате да опитате да поставите вашия код в секцията &#8220;Текст&#8221;. В противен случай, можете да опитате новата джаджа &#8220;Собствен HTML&#8221;!','Did you just paste HTML?'=>'HTML ли поставихте току що?','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by scanning the list of available widgets on this screen. Check it out to add some custom code to your site!'=>'Знаете ли че вече имаме нова джаджа &#8220;Собствен HTML&#8221;? Можете да я откриете като прегледате списъка с налични джаджи на този екран. Използвайте я, за да добавите собствен код към сайта си.','Did you know there is a &#8220;Custom HTML&#8221; widget now? You can find it by pressing the &#8220;<a class="add-widget" href="#">Add a Widget</a>&#8221; button and s